import Img_2 from "./img-2.svg";
import Img_3 from "./img-3.svg";

const Sdata = [
  {
    imgsrc: Img_2,
    title: "Web Development",
  },
  {
    imgsrc: Img_3,
    title: "App Development",
  },
  {
    imgsrc: Img_2,
    title: "Software Development",
  },
  {
    imgsrc: Img_3,
    title: "Digital Marketing",
  },
  {
    imgsrc: Img_2,
    title: "Web Development",
  },
  {
    imgsrc: Img_3,
    title: "Android Development",
  },
];

export default Sdata;
